import React from "react";
import "./Menu.css";

const Menu = () => {
  <div>
    <h2>Home</h2>
    <h2>About</h2>
    <h2>Skills</h2>
    <h2>Education</h2>
    <h2>Work Experience</h2>
    <h2>Contact</h2>
  </div>;
};

export default Menu;
